import SearchBar from "../SearchBar/SearchBar";
import style from '../Nav/Nav.module.css'
import { useNavigate, Link } from "react-router-dom";

function Nav(props) {
    const {onSearch} = props;
    const navigate = useNavigate();

    const handleClick = ()=> {
        navigate('/home');
    }

    return(
        <nav className={style.nav} onClick={handleClick}>
            <Link to='/about' className={style.btnAb}>About</Link>
            <Link to='/favorites' className={style.btnNav}>Favorites</Link>
            <SearchBar onSearch={onSearch} />    
        </nav> 
    )
}


export default Nav;
